% Load data.X = load('s2.dat');X = X(:,[1 2]);% DBSCAN% initialize parameters ( you can change them to see the difference)eps = 1.0minPts = 4% initialize indices that contains the label/cluster info of every datapoint.labels = zeros(size(X,1), 1);% 0 - the datapoint hasn't been touched% -1 - the datapoint is considered as noise% any positive integer (e.g 1,2,3,4,...) cluster labelC = 1 % current cluster label starts with 1 % walk through all data points:[m, n] = size(X);for i = 1:m     % check every points, find neighbors, and extend clusters  % YOUR CODE HERE  if labels(i) == 0 || labels(i) == -1     neighbors = findNeighbors(X, i, eps);          if length(neighbors) < minPts         labels(i) = -1;     end          if length(neighbors) >= minPts         labels = extendCluster(X, labels, i, neighbors, C, eps, minPts);         C = C + 1;     end  end  % END OF CODE    end% Plotscatter(X(:,1), X(:,2), 32, labels, 'filled')